import React, { Component } from 'react'; 
import './index.css';

export default class Navbar extends Component {

  handleGoalClick = (event) => {
    // Update the state and change the page content
    event.preventDefault();
    this.props.pageCallback("DailyGoal");
  }

  render() {

    return(
      <div>
          <nav>
              <ul>
                <div className="container">
                  <div className="row">

                    <div className="col d-flex">
                      <li><a href="index.html"><img className="nav-dim" src="./img/logo.png" alt="Animal Forest logo"/></a></li>
                    </div>

                    <div className="col-7 d-flex"></div>
                        <div className="col d-flex pt-2">
                            <li onClick={this.handleClick}><div aria-label="Change Goal">Set Goal</div></li>
                            {/* <li><a href="About.html" aria-label="About page">About</a></li> */}
                        </div> 
                  </div>
                </div>
              </ul>
          </nav>
      </div>
    );
  }
}
